import React from "react";
import { Col, Container, Row, Card } from "react-bootstrap";

import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import MensImage from "../assets/essential-captoe.png";
import BagImage from "../assets/RyanHunter/IMG_2685.JPG";
import FeatureImage from "../assets/RyanHunter/layercakexjm-19.JPG";

const CollabPage = () => {
  return (
    <motion.div
      initial={{ opacity: 0, y: -50 }}
      animate={{ opacity: 1, y: 0 }}
      fluid
      className="justify-content-center align-center container"
    >
      <Col sm={true}>
        <Row noGutters={true} xs={1} md={1} lg={1} className="w-100">
          <motion.div
          whileHover={{ scale: 1.2 }}
  whileTap={{ scale: 0.8 }}
  style={{ x: 100 }}
            className="card"
            as={Link}
            to="/collabdetail"
            border="light"
            style={{ color: "#1f1f1f" }}
          >
            <Card.Img
              thumbnail
              src={FeatureImage}
              width={100}
              alt="Card image"
            />
            <Card.ImgOverlay bg="dark">
              <Card.Text className="text-left text-uppercase">
                <h5>LayerCake Los Angeles</h5>
              </Card.Text>
            </Card.ImgOverlay>
          </motion.div>
        </Row>
        <Row xs={1} md={2} lg={2}>
          <Col>
            <motion.div border="light" className="w-100 h-100 card">
              <Card.Img
                src={BagImage}
                width="100%"
                height="100%"
                alt="Card image"
                style={{objectFit: "cover"}}
              />
              <Card.ImgOverlay>
                <Card.Title className="text-left text-uppercase">
                  Ryan Hunter
                </Card.Title>
              </Card.ImgOverlay>
            </motion.div>
          </Col>
          <Col>
            <motion.div className="card" border="light">
              <Card.Img
                src={MensImage}
                width="100%"
                height="100%"
                alt="Card image"
                className="p-2 pt-5"
              />
              <Card.ImgOverlay>
                <Card.Title className="text-left text-uppercase">
                  Exchange LA
                </Card.Title>
              </Card.ImgOverlay>
            </motion.div>
          </Col>
        </Row>
      </Col>
    </motion.div>
  );
};

export default CollabPage;
